import React from 'react';
import web from "../src/images/3D-Transparent-PNG.png"
import Common from './Common';

const Home = () => {
    return(
    <>
    
       <Common name="THE SHADOW OF INNOVATION" 
       sideimg={web} 
       visit="/Service" 
       btname="Get started" 
        brand="Dance Nd Art"
        abt="Online Platform for Dancer and Artist"
       />
      
    </>
    )
}

export default Home;
